import { Modal } from 'react-bootstrap';

import { getYoutubeID } from '../utils';

function VideoPlayerModal( props ) {
  const { videoUrl, ...rest } = props;
  console.log(getYoutubeID(videoUrl));
  return (
    <Modal
      {...rest}
      size="lg"
      backdropClassName="VideoIframe-Backdrop"
      dialogClassName="VideoIframe"
      aria-labelledby="VideoPlayerModal"
      centered
    >
      <Modal.Header closeButton></Modal.Header>
      <Modal.Body>
        {videoUrl}
        <iframe 
          width="100%" 
          height="100%" 
          src="https://www.youtube.com/embed/_1juTr9E46U?rel=0" 
          frameBorder="0" 
          allow="" 
          allowFullScreen={true}
        ></iframe>
      </Modal.Body>
    </Modal>
  );
}

export default VideoPlayerModal;
